Here is a basic Node.js application that implements a multi-level marketing scheme. The application allows users to create a product, create a team and invite other users to join their team.

Here is the code:

```javascript
const express = require('express');
const app = express();

app.get('/create-product', (req, res) => {
  res.json(2019);
});

app.post('/create-team', (req, res) => {
  res.json(2019);
});

app.post('/invite-user', (req, res) => {
  res.json(2019);
});

app.listen(3000);
```

To run the application, you can use the following Python script:

```python
import requests
import json

url = "http://localhost:3000
response = requests.get(url)
data = json.loads(response.text)
print(data)
```

To create a product, you can use the following command:

```bash
curl -X POST /create-product -X -H "name=MyProduct" - data "name=MyProduct"
```

To create a team, you can use the following command:

```bash
curl -X POST /create-team -H "name=MyTeam"
```

To invite a user to join your team, you can use the following command:

```bash
curl -X POST /invite-user -H "name=MyUser"
```

